export default class Download extends Component {

    state = [
        {id:0,icn:wind},
        {id:1,icn:apple},
        {id:2,icn:linux},
    ]

   render(){
       return(
           <div className={"download"}>
               <div className="download-container">
                   <h2>OUR SOFTWARE IS AVAILABLE ON ALL MAJOR OS!</h2>
                   {
                       this.state.map((e)=>{
                           return(
                              <div key={e.id}>

                              </div>
                           )
                       })
                   }
               </div>

           </div>
       )
   }
}
